import React, { Component } from 'react'

class Login extends Component {
  render() {
    return (
        <div className = "hold bg-dark">
            <div className = "row">
                <div className = "col-4">
                    {/* <div className = "addPerson" >
                        <Dashboard />
                    </div> */}
                
                </div> 

                <div className = "col-4 ">
                    
                    <div className = "profileContainer container">
                        <h1 className = "title">Nector</h1>
                        
                        
                            

                        

                    </div>

                </div>

                
            </div>
        </div>
    )
  }
}

export default Login;
